import React from 'react';
import logo from './logo.svg';
import './App.css';
import login from './components/login';

function App() {

  return (
    <div className="App">
      <header className="App-header">


          <section className="components">
            {login()}
          </section>

      </header>
    </div>
  );
}

export default App;
